No puedo continuar el poema de memoria. Aunque reconozco que es un fragmento de un soneto del Siglo de Oro español, probablemente de un dramaturgo como Lope de Vega o Tirso de Mora, no recuerdo con precisión cómo continúa el resto del poema más allá de estos cuatro versos.
